    January 7 2004 regarding the December Monthly Report. Memo schedules for the joint
    fundraisers ASDC/Dollars for Democrats and DNC State Party Victory Fund are provided
    to us on a quarterly basis and will be included with the Year End report.    Offsets
    reported from Senate Democratic Leadership Fund and Building Oregon With Leadership
    are for rent. The Democratic Party of Oregon shares office space with several
    organizations. We write one check to pay the rent and utilities. The other organizations
    reimburse us for their portion of these expenses.   Prior to this report our software  had  a
    rounding error affecting the calculations for year to date totals for Lines 21ai
    and 21aii. This error has now been fixed. Please note that there is $0.05  difference
    on these lines when the period total for this report is added to the year to date
    total from the previous report.",
